CREATE TABLE IF NOT EXISTS "__EFMigrationsHistory" (
    "MigrationId" character varying(150) NOT NULL,
    "ProductVersion" character varying(32) NOT NULL,
    CONSTRAINT "PK___EFMigrationsHistory" PRIMARY KEY ("MigrationId")
);

START TRANSACTION;
CREATE TABLE "AlertSenders" (
    "Id" uuid NOT NULL,
    "Code" character varying(6) NOT NULL,
    "Name" character varying(256) NOT NULL,
    "CreatedOn" timestamp with time zone NOT NULL,
    "CreatedBy" uuid,
    "ModifiedOn" timestamp with time zone,
    "ModifiedBy" uuid,
    "DeletedOn" timestamp with time zone,
    "DeletedBy" uuid,
    CONSTRAINT "PK_AlertSenders" PRIMARY KEY ("Id")
);

CREATE TABLE "AlertTypes" (
    "Id" uuid NOT NULL,
    "ProductCode" character varying(6) NOT NULL,
    "Name" character varying(256) NOT NULL,
    "Description" character varying(4096) NOT NULL,
    "Level" text NOT NULL,
    "EventCode" character varying(6),
    "TypeCode" text GENERATED ALWAYS AS (COALESCE("EventCode", "ProductCode")) STORED NOT NULL,
    "CreatedOn" timestamp with time zone NOT NULL,
    "CreatedBy" uuid,
    "ModifiedOn" timestamp with time zone,
    "ModifiedBy" uuid,
    "DeletedOn" timestamp with time zone,
    "DeletedBy" uuid,
    CONSTRAINT "PK_AlertTypes" PRIMARY KEY ("Id")
);

CREATE TABLE "Events" (
    "Id" uuid NOT NULL,
    "Type" character varying(256) NOT NULL,
    "Payload" text NOT NULL,
    "Failures" integer NOT NULL,
    "HandledOn" timestamp with time zone,
    CONSTRAINT "PK_Events" PRIMARY KEY ("Id")
);

CREATE TABLE "Roles" (
    "Id" uuid NOT NULL,
    "CreatedOn" timestamp with time zone NOT NULL,
    "CreatedBy" uuid,
    "ModifiedOn" timestamp with time zone,
    "ModifiedBy" uuid,
    "DeletedOn" timestamp with time zone,
    "DeletedBy" uuid,
    "Name" character varying(256),
    "NormalizedName" character varying(256),
    "ConcurrencyStamp" text,
    CONSTRAINT "PK_Roles" PRIMARY KEY ("Id")
);

CREATE TABLE "Users" (
    "Id" uuid NOT NULL,
    "CreatedOn" timestamp with time zone NOT NULL,
    "CreatedBy" uuid,
    "ModifiedOn" timestamp with time zone,
    "ModifiedBy" uuid,
    "DeletedOn" timestamp with time zone,
    "DeletedBy" uuid,
    "UserName" character varying(256),
    "NormalizedUserName" character varying(256),
    "Email" character varying(256),
    "NormalizedEmail" character varying(256),
    "EmailConfirmed" boolean NOT NULL,
    "PasswordHash" text,
    "SecurityStamp" text,
    "ConcurrencyStamp" text,
    "PhoneNumber" text,
    "PhoneNumberConfirmed" boolean NOT NULL,
    "TwoFactorEnabled" boolean NOT NULL,
    "LockoutEnd" timestamp with time zone,
    "LockoutEnabled" boolean NOT NULL,
    "AccessFailedCount" integer NOT NULL,
    CONSTRAINT "PK_Users" PRIMARY KEY ("Id")
);

CREATE TABLE "Zones" (
    "Id" uuid NOT NULL,
    "Code" character varying(6) NOT NULL,
    "Name" character varying(256) NOT NULL,
    "CreatedOn" timestamp with time zone NOT NULL,
    "CreatedBy" uuid,
    "ModifiedOn" timestamp with time zone,
    "ModifiedBy" uuid,
    "DeletedOn" timestamp with time zone,
    "DeletedBy" uuid,
    CONSTRAINT "PK_Zones" PRIMARY KEY ("Id")
);

CREATE TABLE "Alerts" (
    "Id" uuid NOT NULL,
    "TypeId" uuid NOT NULL,
    "SenderId" uuid NOT NULL,
    "Headline" character varying(256) NOT NULL,
    "Description" character varying(4096) NOT NULL,
    "Instruction" character varying(4096) NOT NULL,
    "SentOn" timestamp with time zone NOT NULL,
    "EffectiveOn" timestamp with time zone NOT NULL,
    "BeginsOn" timestamp with time zone NOT NULL,
    "ExpiresOn" timestamp with time zone NOT NULL,
    "EndsOn" timestamp with time zone NOT NULL,
    "MessageType" text NOT NULL,
    "Severity" text NOT NULL,
    "Certainty" text NOT NULL,
    "Urgency" text NOT NULL,
    "Response" text NOT NULL,
    "IsEffectuated" boolean NOT NULL,
    "IsExpired" boolean NOT NULL,
    "ExternalId" text,
    "CreatedOn" timestamp with time zone NOT NULL,
    "CreatedBy" uuid,
    "ModifiedOn" timestamp with time zone,
    "ModifiedBy" uuid,
    "DeletedOn" timestamp with time zone,
    "DeletedBy" uuid,
    CONSTRAINT "PK_Alerts" PRIMARY KEY ("Id"),
    CONSTRAINT "FK_Alerts_AlertSenders_SenderId" FOREIGN KEY ("SenderId") REFERENCES "AlertSenders" ("Id") ON DELETE CASCADE,
    CONSTRAINT "FK_Alerts_AlertTypes_TypeId" FOREIGN KEY ("TypeId") REFERENCES "AlertTypes" ("Id") ON DELETE CASCADE
);

CREATE TABLE "RoleClaims" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "RoleId" uuid NOT NULL,
    "ClaimType" text,
    "ClaimValue" text,
    CONSTRAINT "PK_RoleClaims" PRIMARY KEY ("Id"),
    CONSTRAINT "FK_RoleClaims_Roles_RoleId" FOREIGN KEY ("RoleId") REFERENCES "Roles" ("Id") ON DELETE CASCADE
);

CREATE TABLE "UserClaims" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "UserId" uuid NOT NULL,
    "ClaimType" text,
    "ClaimValue" text,
    CONSTRAINT "PK_UserClaims" PRIMARY KEY ("Id"),
    CONSTRAINT "FK_UserClaims_Users_UserId" FOREIGN KEY ("UserId") REFERENCES "Users" ("Id") ON DELETE CASCADE
);

CREATE TABLE "UserLogins" (
    "LoginProvider" character varying(256) NOT NULL,
    "ProviderKey" character varying(256) NOT NULL,
    "ProviderDisplayName" text,
    "UserId" uuid NOT NULL,
    CONSTRAINT "PK_UserLogins" PRIMARY KEY ("LoginProvider", "ProviderKey"),
    CONSTRAINT "FK_UserLogins_Users_UserId" FOREIGN KEY ("UserId") REFERENCES "Users" ("Id") ON DELETE CASCADE
);

CREATE TABLE "UserRoles" (
    "UserId" uuid NOT NULL,
    "RoleId" uuid NOT NULL,
    CONSTRAINT "PK_UserRoles" PRIMARY KEY ("UserId", "RoleId"),
    CONSTRAINT "FK_UserRoles_Roles_RoleId" FOREIGN KEY ("RoleId") REFERENCES "Roles" ("Id") ON DELETE CASCADE,
    CONSTRAINT "FK_UserRoles_Users_UserId" FOREIGN KEY ("UserId") REFERENCES "Users" ("Id") ON DELETE CASCADE
);

CREATE TABLE "UserTokens" (
    "UserId" uuid NOT NULL,
    "LoginProvider" character varying(256) NOT NULL,
    "Name" character varying(256) NOT NULL,
    "Value" text,
    CONSTRAINT "PK_UserTokens" PRIMARY KEY ("UserId", "LoginProvider", "Name"),
    CONSTRAINT "FK_UserTokens_Users_UserId" FOREIGN KEY ("UserId") REFERENCES "Users" ("Id") ON DELETE CASCADE
);

CREATE TABLE "AlertParameters" (
    "Id" uuid NOT NULL,
    "Key" character varying(256) NOT NULL,
    "Value" character varying(4096) NOT NULL,
    "AlertId" uuid NOT NULL,
    "CreatedOn" timestamp with time zone NOT NULL,
    "CreatedBy" uuid,
    "ModifiedOn" timestamp with time zone,
    "ModifiedBy" uuid,
    "DeletedOn" timestamp with time zone,
    "DeletedBy" uuid,
    CONSTRAINT "PK_AlertParameters" PRIMARY KEY ("Id"),
    CONSTRAINT "FK_AlertParameters_Alerts_AlertId" FOREIGN KEY ("AlertId") REFERENCES "Alerts" ("Id") ON DELETE CASCADE
);

CREATE TABLE "AlertZones" (
    "Id" uuid NOT NULL,
    "AlertId" uuid NOT NULL,
    "ZoneId" uuid NOT NULL,
    "CreatedOn" timestamp with time zone NOT NULL,
    "CreatedBy" uuid,
    "ModifiedOn" timestamp with time zone,
    "ModifiedBy" uuid,
    "DeletedOn" timestamp with time zone,
    "DeletedBy" uuid,
    CONSTRAINT "PK_AlertZones" PRIMARY KEY ("Id"),
    CONSTRAINT "FK_AlertZones_Alerts_AlertId" FOREIGN KEY ("AlertId") REFERENCES "Alerts" ("Id") ON DELETE CASCADE,
    CONSTRAINT "FK_AlertZones_Zones_ZoneId" FOREIGN KEY ("ZoneId") REFERENCES "Zones" ("Id") ON DELETE CASCADE
);

