INSERT INTO "AlertTypes" ("Id", "CreatedBy", "CreatedOn", "DeletedBy", "DeletedOn", "Description", "EventCode", "Level", "ModifiedBy", "ModifiedOn", "Name", "ProductCode")
VALUES ('43f44630-21db-4421-871d-f2d327489552', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', NULL, NULL, 'Issued to inform the public, emergency management, and other cooperating agencies that flash flooding is in progress, imminent, or highly likely.', 'FFW', 'Warning', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', 'Flash Flood Warning', 'FFW');
INSERT INTO "AlertTypes" ("Id", "CreatedBy", "CreatedOn", "DeletedBy", "DeletedOn", "Description", "EventCode", "Level", "ModifiedBy", "ModifiedOn", "Name", "ProductCode")
VALUES ('4a4461ce-2b48-4dfb-938b-e40a8ce35437', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', NULL, NULL, 'A weather statement issued when a specified hazard is approaching advisory criteria or to highlight upcoming significant weather events. These are issued to advise of ongoing or imminent hazardous convective weather expected to continue/dissipate or expand/decrease in geographical coverage within the next one to two hours, major events forecast to occur beyond a six-hour timeframe (such as substantial temperature changes, dense fog and winter weather events), sub-severe thunderstorms (containing sustained winds or gusts of 40–57 mph (64–92 km/h) and/or hail less than one inch (2.5 cm) in diameter, in addition to frequent to continuous lightning and/or funnel clouds not expected to become a tornado threat), or to outline high-impact events supplementary to information contained in other hazardous weather products (such as black ice, short-duration heavy snow or lake-effect snow bands expected to briefly reduce visibility, heavy rainfall not expected to cause flooding, heat index or wind chill values expected to approach "advisory" criteria for one or two hours, or local areas of blowing dust where wind is below advisory criteria).', NULL, 'Advisory', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', 'Special Weather Statement', 'SPS');
INSERT INTO "AlertTypes" ("Id", "CreatedBy", "CreatedOn", "DeletedBy", "DeletedOn", "Description", "EventCode", "Level", "ModifiedBy", "ModifiedOn", "Name", "ProductCode")
VALUES ('4a4f23be-9135-4bcb-bb19-7f39a8a8a25d', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', NULL, NULL, 'This is issued by the National Weather Service when conditions are favorable for the development of tornadoes in and close to the watch area. Their size can vary depending on the weather situation. They are usually issued for a duration of 4 to 8 hours. They normally are issued well in advance of the actual occurrence of severe weather. During the watch, people should review tornado safety rules and be prepared to move a place of safety if threatening weather approaches.', 'TOA', 'Watch', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', 'Tornado Watch', 'WOU');
INSERT INTO "AlertTypes" ("Id", "CreatedBy", "CreatedOn", "DeletedBy", "DeletedOn", "Description", "EventCode", "Level", "ModifiedBy", "ModifiedOn", "Name", "ProductCode")
VALUES ('5434ef57-6bd0-4dda-8e72-bde8fc4bb7d5', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', NULL, NULL, 'In hydrologic terms, a statement by the NWS which provides follow-up information on flash flood watches and warnings.', 'FFS', 'Advisory', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', 'Flash Flood Statement', 'FFS');
INSERT INTO "AlertTypes" ("Id", "CreatedBy", "CreatedOn", "DeletedBy", "DeletedOn", "Description", "EventCode", "Level", "ModifiedBy", "ModifiedOn", "Name", "ProductCode")
VALUES ('5e82b31c-c3f7-4911-8d54-2944d6782ba8', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', NULL, NULL, 'This is issued when a tornado is indicated by the WSR-88D radar or sighted by spotters; therefore, people in the affected area should seek safe shelter immediately. They can be issued without a Tornado Watch being already in effect. They are usually issued for a duration of around 30 minutes.', 'TOW', 'Warning', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', 'Tornado Warning', 'TOR');
INSERT INTO "AlertTypes" ("Id", "CreatedBy", "CreatedOn", "DeletedBy", "DeletedOn", "Description", "EventCode", "Level", "ModifiedBy", "ModifiedOn", "Name", "ProductCode")
VALUES ('a312351a-fb7b-40bd-9e9d-685d0840ed01', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', NULL, NULL, 'Issued to indicate current or developing hydrologic conditions that are favorable for flash flooding in and close to the watch area, but the occurrence is neither certain or imminent.', 'FFA', 'Watch', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', 'Flash Flood Watch', 'FFA');
INSERT INTO "AlertTypes" ("Id", "CreatedBy", "CreatedOn", "DeletedBy", "DeletedOn", "Description", "EventCode", "Level", "ModifiedBy", "ModifiedOn", "Name", "ProductCode")
VALUES ('a349126f-92f1-4222-a3cf-bd105b7764f5', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', NULL, NULL, 'This is issued when either a severe thunderstorm is indicated by the WSR-88D radar or a spotter reports a thunderstorm producing hail one inch or larger in diameter and/or winds equal or exceed 58 miles an hour; therefore, people in the affected area should seek safe shelter immediately. Severe thunderstorms can produce tornadoes with little or no advance warning. Lightning frequency is not a criteria for issuing a severe thunderstorm warning. They are usually issued for a duration of one hour. They can be issued without a Severe Thunderstorm Watch being already in effect.', 'SVW', 'Warning', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', 'Severe Thunderstorm Warning', 'SVR');
INSERT INTO "AlertTypes" ("Id", "CreatedBy", "CreatedOn", "DeletedBy", "DeletedOn", "Description", "EventCode", "Level", "ModifiedBy", "ModifiedOn", "Name", "ProductCode")
VALUES ('be8f23f2-23b1-4f6a-9919-e48d854cb243', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', NULL, NULL, 'This is issued by the National Weather Service when conditions are favorable for the development of severe thunderstorms in and close to the watch area. A severe thunderstorm by definition is a thunderstorm that produces one inch hail or larger in diameter and/or winds equal or exceed 58 miles an hour. The size of the watch can vary depending on the weather situation. They are usually issued for a duration of 4 to 8 hours. They are normally issued well in advance of the actual occurrence of severe weather. During the watch, people should review severe thunderstorm safety rules and be prepared to move a place of safety if threatening weather approaches.', 'SVA', 'Watch', '11111111-0000-0000-0000-000000000000', TIMESTAMPTZ '2025-05-25T00:00:00+00:00', 'Severe Thunderstorm Watch', 'WOU');
INSERT INTO "AlertTypes" ("Id", "CreatedBy", "CreatedOn", "DeletedBy", "DeletedOn", "Description", "EventCode", "Level", "ModifiedBy", "ModifiedOn", "Name", "ProductCode")
